import React from 'react'
import styled from 'styled-components'
import Mesaje from '../components/Mesaje'
import Navbar from '../components/Navbar'
import Footer from '../components/Footer'

const Container = styled.div``;

const Wrapper = styled.div`
padding: 20px`;

const Title = styled.h1`
font-weight: 250;
text-align: center;
`;

const Top = styled.div`
padding: 15px;
display: flex;
align-items: center;
justify-content: space-between;
`;

const TopButton = styled.button`
padding: 10px;
cursor: pointer;
border: ${(props) => props.type === "filled" && "none"};
  background-color: ${(props) =>
        props.type === "filled" ? "black" : "transparent"};
  color: ${(props) => props.type === "filled" && "white"};
`;

const TopTexts = styled.div``;

const TopText = styled.span`
text-decoration: underline;
cursor: pointer;
margin: 0px 10px
`;
const Bottom = styled.div`
display: flex;
justify-content: space-between;

`;

const Info = styled.div`
flex: 3;`;

const Summary = styled.div`
flex: 1
`;

const Product = styled.div`
display: flex;
justify-content: space-between;
`;
const ProductName = styled.span``;
const ProductDetail = styled.div`
flex: 2
display: flex;
`;

const ProductImage = styled.img`
width: 200px;
`;

const ProductDetails = styled.div`
padding: 20px;
display: flex;
flex-direction: column;
justify-content: space-around;
`;

const ProductId = styled.span``;

const ProductColor = styled.div`
  width: 20px;
  height: 20px;
  border-radius: 50%;
  background-color: ${(props) => props.color};
`;


const ProductSize = styled.span``;

const PriceDetail = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

const ProductQuantityContainer = styled.div`
display: flex;
  align-items: center;
  margin-bottom: 20px;
;`

const Quantity = styled.div`
font-size: 24px;
  margin: 5px;
  ${mobile({ margin: "5px 15px" })}
`;


const ProductPrice = styled.div`
font-size: 24px;
  margin: 5px;
  ${mobile({ margin: "5px 15px" })};
`;

const Cart = () => {
    return (
        <Container>
            <Mesaje></Mesaje>
            <Navbar></Navbar>
            <Wrapper>
                <Title>Cosul tau</Title>
                <Top>
                    <TopButton>Continua cumparaturile</TopButton>
                    <TopTexts>
                        <TopText>Cosul tau(2)</TopText>
                        <TopText>Favorite (0)</TopText>
                    </TopTexts>
                    <TopButton type="filled">Finalizeaza comanda</TopButton>
                </Top>
                <Bottom>
                    <Info>
                        <Product>
                            <ProductDetail>
                                <ProductImage src="" />
                                <ProductDetails>
                                    <ProductName>
                                        <b>Product:</b> CASCA DE PROTECTIE MT
                                    </ProductName>
                                    <ProductId>
                                        <b>ID:</b> 4551452151
                                    </ProductId>
                                    <ProductColor color="black" />
                                    <ProductSize>
                                        <b>Size:</b> M
                                    </ProductSize>
                                </ProductDetails>
                            </ProductDetail>
                            <PriceDetail>
                                <ProductQuantityContainer>
                                    <Add />
                                    <Quantity>2</Quantity>
                                    <Remove />
                                </ProductQuantityContainer>
                                <ProductPrice>250 LEI</ProductPrice>
                            </PriceDetail>
                        </Product>
                        <Hr />
                        <Product>
                            <ProductDetail>
                                <ProductImage src="" />
                                <ProductDetails>
                                    <ProductName>
                                        <b>Product:</b> HAKURA T-SHIRT
                                    </ProductName>
                                    <ProductId>
                                        <b>ID:</b> 4557585577
                                    </ProductId>
                                    <ProductColor color="gray" />
                                    <ProductSize>
                                        <b>Size:</b> M
                                    </ProductSize>
                                </ProductDetails>
                            </ProductDetail>
                            <PriceDetail>
                                <ProductQuantityContainer>
                                    <Add />
                                    <ProductQuantityt>1</ProductQuantityt>
                                    <Remove />
                                </ProductQuantityContainer>
                                <ProductPrice>450 LEI</ProductPrice>
                            </PriceDetail>
                        </Product>
                    </Info>
                </Bottom>
            </Wrapper>
            <Footer />
        </Container>
    );
};

export default Cart
